pragma solidity 0.4.23;

contract Set{
    string public nolanStr;
    constructor() public {
        nolanStr = "hello nn";
    }

    function set(string _str) public {
        nolanStr = _str;
    }

    function get() public returns(string){
        return nolanStr;
    }
}

